import './index.css';
import * as serviceWorker from './serviceWorker';
import state, {addNewPosts, addUser} from './Redux/state'
import ReactDOM from "react-dom";
import App from "./App";

let refresh = (state, addUser, addNewPosts) =>{
    debugger;
    ReactDOM.render(<App state = {state} addUser={addUser} addNewPost={addNewPosts}
                           />, document.getElementById('root'));
};

refresh(state, addUser,addNewPosts);

